%% run_final_check.m
clear; close all; clc;

% 环境设置
% x_len = 5; y_len = 5;
% start = [1, 1]; final = [3, 4];
% obs = [2,2; 3,2; 3,3; 2,4; 4,4; 2,5];

x_len = 2; y_len = 2;
start = [1, 1]; final = [2, 2];
obs = [1,2];

% start对结果不起作用  这里只是为了统一接口。后面Sarsa算法会用到
env = GridWorld(x_len, y_len, start, final, obs);

% Agent 设置
gamma = 0.9;
episode_len = 100;
pe_len = 10;
agent = PolicyIterationAgent(env.State_Space_Size, 5, gamma, episode_len, pe_len);

% 训练
agent.train(env); %[output:37ebdc29]

% 结果
[V, Pol] = agent.get_results();

% 打印验证
final_idx = env.coord2idx(final);
target_val = V(final_idx);
fprintf('终点价值: %.2f (预期 10.00)\n', target_val); %[output:461f26e5]

% 绘图
env.plot_values(V); %[output:4b096c0a]
env.plot_policy(Pol);  % 暂时不能绘制概率策略 %[output:8ad1852e]
env.plot_3d_bar_chart(V); %[output:60dc1b6a]
%%
% 在训练完成后，计算ε-greedy策略下的价值
epsilon = 1;   % 平均概率为0.2
episodes_len = 1000;
max_steps = 100;
num_iterations = 5000;

agent = PolicyIterationAgent(env.State_Space_Size, 5, gamma, episodes_len, max_steps);
env.Reward_Forbidden = -1;
% 注意注释掉env中step函数下的终点吸收规则
V_epsilon = agent.evaluate_epsilon_greedy_policy(env, epsilon, num_iterations); %[output:13258e65]
env.plot_values(V_epsilon); %[output:77994fe7]
%%
%% main_td_value.m - 算法 8.1: 基于值函数的 TD 算法
%% main_td_value.m - 算法 8.1: 基于值函数的 TD 算法
clear; close all; clc;

% 1. 环境设置
% x_len = 5; y_len = 5;
% start = [1, 1]; final = [3, 4];
% obs = [2,2; 3,2; 3,3; 2,4; 4,4; 2,5];
%%\
x_len = 2; y_len = 2;
start = [1, 1]; final = [2, 2];
obs = [1,2];

env = GridWorld(x_len, y_len, start, final, obs);
env.Reward_Forbidden = -1;

% 2. 实验参数
episodes = 200000;
max_steps = 1;
alpha = 0.01;
gamma = 0.9;



% 3. 基函数配置 - 现在更灵活
basis_type = 'quadratic'; % 可选: 'linear', 'quadratic', 'custom'
switch basis_type
    case 'linear'
        % 线性基函数: [1, x, y]
        phi_func = @(x, y) [1; x; y];
        dim = 3;
        
    case 'quadratic'
        % 二次基函数: [1, x, y, x^2, y^2, x*y]
        % phi_func = @(x, y) [1; x; y; x^2; y^2; x*y];
        phi_func = @(x, y) [1; x; y; x^2; y^2; x*y; x^3; y^3; x^2*y; x*y^2];
        % dim = 6;
        dim = 10;
        
    case 'custom'
        % 自定义基函数 - 示例: [1, x, y, sin(pi*x/5), sin(pi*y/5)]
        phi_func = @(x, y) [1; x; y; sin(pi*x/5); sin(pi*y/5)];
        dim = 5;
end

% 4. 初始化参数
omega = zeros(dim, 1);
V_table = zeros(x_len, y_len); % 用于存放 v(s,ω)输出的数据

% 5. 历史记录
omega_history = [];
s_history = [];

% 6. 主循环
siCoord = env.Start_State;
for i = 1:episodes
    s_idx = env.coord2idx(siCoord);
    a_idx = choose_action(s_idx, 0.3);
    
    [next_state_idx, reward, is_done] = env.step(s_idx, a_idx);
    next_state_coord = env.idx2coord(next_state_idx);

    % 提取当前状态坐标
    x = siCoord(1);
    y = siCoord(2);
    
    % 计算特征向量
    phi_s = phi_func(x, y);
    
    % 计算下一个状态的特征向量
    next_coord = env.idx2coord(next_state_idx);
    phi_s_next = phi_func(next_coord(1), next_coord(2));
    
    % TD更新
    td_error = reward + gamma * (phi_s_next' * omega) - (phi_s' * omega);
    omega = omega + alpha * td_error * phi_s;
    % 表格法TD  两个其实可以同步更新
    td_error = reward + gamma * V_table(next_state_coord(1),next_state_coord(2)) - V_table(siCoord(1),siCoord(2));
    V_table(siCoord(1),siCoord(2)) = V_table(siCoord(1),siCoord(2)) + alpha * td_error;

    % 历史记录
    % omega_history = [omega_history, omega];
    s_history = [s_history, s_idx];
    
    % 更新当前状态
    siCoord = env.idx2coord(next_state_idx);
end
%%
% 7. 绘制值函数的三维网格图
plot_value_function_grid(x_len, y_len, omega, phi_func, basis_type); %[output:33726f36]
env.plot_3d_bar_chart([V_table(1,:),V_table(2,:)]') %[output:6ba1dafb]
%% === 辅助函数 ===
function a_idx = choose_action(s_idx, Epsilon)
    % 简单的随机选择动作
    Num_Actions = 5;
    a_idx = randi(Num_Actions); % 平均策略
end

function plot_value_function_grid(x_len, y_len, omega, phi_func, basis_type)
    % 绘制值函数的三维网格图
    % 输入:
    %   x_len, y_len: 网格尺寸
    %   omega: 学习到的权重向量
    %   phi_func: 基函数句柄
    %   basis_type: 基函数类型（用于标题显示）
    
    % 创建网格
    [X, Y] = meshgrid(1:x_len, 1:y_len);
    
    % 计算每个网格点的值函数
    V_grid = zeros(y_len, x_len);
    for i = 1:x_len
        for j = 1:y_len
            % 计算特征向量
            phi_ij = phi_func(i, j);
            % 计算值函数估计
            V_grid(j, i) = phi_ij' * omega;
        end
    end
    
    % 绘制三维表面图
    figure('Position', [100, 100, 800, 600]);
    surf(X, Y, V_grid, 'FaceColor', 'interp','FaceAlpha', 0.3);
    
    % 美化图形
    colormap(jet); % 使用jet颜色映射
    colorbar; % 添加颜色条
    
    % 添加标签和标题
    xlabel('X坐标', 'FontSize', 12);
    ylabel('Y坐标', 'FontSize', 12);
    zlabel('值函数 V(s)', 'FontSize', 12);
    title(sprintf('值函数估计 (基函数: %s)', basis_type), 'FontSize', 14);
    
    % 添加网格
    grid on;
    
    % 设置视角
    view(45, 30); % 调整视角以便更好地查看
    
    % 添加等高线投影
    hold on;
    contour3(X, Y, V_grid, 10, 'k:', 'LineWidth', 0.5);
    hold off;
end

%% === 额外的通用基函数示例 ===
% 如果需要，可以在主程序外部定义更多基函数类型：
function phi = basis_polynomial(x, y, degree)
    % 多项式基函数
    % degree: 多项式阶数
    
    phi = [1]; % 常数项
    
    % 添加线性项
    if degree >= 1
        phi = [phi; x; y];
    end
    
    % 添加二次项
    if degree >= 2
        phi = [phi; x^2; y^2; x*y];
    end
    
    % 添加三次项
    if degree >= 3
        phi = [phi; x^3; y^3; x^2*y; x*y^2];
    end
end

function phi = basis_fourier(x, y, max_freq)
    % 傅里叶基函数
    % max_freq: 最大频率
    
    % 归一化坐标到 [0, 1] 区间
    x_norm = (x-1) / 4; % 假设网格是5x5
    y_norm = (y-1) / 4;
    
    phi = [1]; % 常数项
    
    for i = 0:max_freq
        for j = 0:max_freq
            if i == 0 && j == 0
                continue; % 常数项已添加
            end
            % 添加余弦项
            phi = [phi; cos(pi*i*x_norm) * cos(pi*j*y_norm)];
            % 添加正弦项
            phi = [phi; sin(pi*i*x_norm) * sin(pi*j*y_norm)];
        end
    end
end



